import React from "react";
import {
  withNavigationContext,
  Link,
} from "react-awesome-slider/dist/navigation";
import "./nav.scss";

const Nav = withNavigationContext(({ fullpage }) => {
  const { slug } = fullpage.navigation;

  return (
    <header className="page-header">
      <div className="page-header__wrapper">
        <div className="page-header__title">
          <img
            className="logo-container"
            src="/assets/logo.png"
            alt="my image"
          />
          <div>
            <h1>
              <span>Crear√© Foundation</span>
            </h1>
            <h2>FULL-PAGE TRANSITION STRATEGY</h2>
            <small>
              Built with {`<3`} by{" "}
              <a target="_blank" href="https://caferati.me">
                @rcaferati
              </a>
            </small>
          </div>
        </div>
        <nav>
          <Link className={slug === "" ? "selected" : null} href="/">
            index
          </Link>
          <Link
            className={slug === "page-two" ? "selected" : null}
            href="/page-two"
          >
            page-two
          </Link>
          <Link
            className={slug === "page-three" ? "selected" : null}
            href="/page-three"
          >
            page-three
          </Link>
        </nav>
      </div>
    </header>
  );
});

export default Nav;
